import React from 'react';


const MainContainerInput = styled.div`
    display: flex;
    justify-content: center;
    flex-direction: column;    
`



class OutputTarefas extends React.Component{
    constructor(props){
        super(props)
    }



    render = () =>{
        return(
            <MainContainerOutput>
                <ul>
                    <li>Tarefa1</li>
                    <li>Tarefa2</li>
                    <li>Tarefa3</li>
                </ul>
            </MainContainerOutput>
        )
    }
}

export default OutputTarefas;
